import React, { useState } from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import './App.css';
import './InsertionSort.css';
import './BubbleSort.css';
import './GraphVisualization.css';
import './TreeVisualisation.css';
import InsertionSort from './InsertionSort';
import BubbleSort from './BubbleSort';
import GraphVisualization from './GraphVisualization';
import TreeVisualisation from './TreeVisualisation';
import MainPage from './mainpage';

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<MainPage />} />
      <Route path="/visualizer" element={<Visualizer />} />
    </Routes>
  );
};

const Chatbot = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const sendMessage = async () => {
    if (!input) return;

    const userMessage = { sender: 'user', text: input };
    setMessages((prev) => [...prev, userMessage]);

    try {
      const response = await fetch('https://generativelanguage.googleapis.com/v1beta/models/gemini-1.5-flash:generateContent?key=GEMINI_API_KEY', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `AIzaSyChht9TTaLA7ZUiIEk7kr2ZeKtzA1GkOZc`, // Replace with your actual API key
        },
        body: JSON.stringify({ message: input }),
      });

      if (!response.ok) {
        throw new Error(`API Error: ${response.status} - ${response.statusText}`);
      }

      const data = await response.json();
      const botMessage = { sender: 'bot', text: data.response || 'No response from bot.' };
      setMessages((prev) => [...prev, botMessage]);
    } catch (error) {
      console.error('Error communicating with chatbot:', error.message);
      const errorMessage = { sender: 'bot', text: `Error: ${error.message}` };
      setMessages((prev) => [...prev, errorMessage]);
    }

    setInput('');
  };
  return (
    <div className="chatbot-box">
      <h2>Chatbot</h2>
      <div className="chatbot-messages">
        {messages.map((message, index) => (
          <div key={index} className={`message ${message.sender}`}>
            {message.text}
          </div>
        ))}
      </div>
      <div className="chatbot-input">
        <input
          type="text"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          placeholder="Type your message..."
        />
        <button onClick={sendMessage}>Send</button>
      </div>
    </div>
  );
  };


const Visualizer = () => {
  const [visualizationType, setVisualizationType] = useState('');
  const [showChatbot, setShowChatbot] = useState(true); // Chatbot enabled by default
  const navigate = useNavigate();

  const showSorting = (algorithm) => setVisualizationType(algorithm);

  return (
    <div className="App">
      <div className="navbar">
        <h1>Algorithm Visualizer</h1>
      </div>
      <div className="algorithm-buttons">
        <div className="dropdown">
          <button className="nav-button">Sort</button>
          <div className="dropdown-content">
            <a href="#" onClick={() => showSorting('bubble')}>Bubble Sort</a>
            <a href="#" onClick={() => showSorting('insertion')}>Insertion Sort</a>
          </div>
        </div>
        <button className="nav-button" onClick={() => setVisualizationType('tree')}>Tree Visualization</button>
        <button className="nav-button" onClick={() => setVisualizationType('graph')}>Graph Visualization</button>
        <button className="nav-button" onClick={() => navigate('/')}>
          Back to Main Menu
        </button>
      </div>
      <div className="grid-container">
        <div id="visualization-container">
          {visualizationType === 'bubble' && <BubbleSort />}
          {visualizationType === 'insertion' && <InsertionSort />}
          {visualizationType === 'graph' && <GraphVisualization />}
          {visualizationType === 'tree' && <TreeVisualisation />}
        </div>
        {showChatbot && <Chatbot />}
      </div>
      <img id="bottom-right-image" src="/assets/image.svg" alt="Bottom Right Image" />
    </div>
  );
};

export default App;
